INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 1, 1, 'und', 0, '<p>Periodic health checks can help ensure that your Unix systems are going to be available when they\'re needed most. In this post, we\'re going to look at some aspects of performance that should be included in your system check-ups and some handy commands that will provide you with some especially useful insights.</p>\r\n\r\n<h3>CPU load</h3>\r\n\r\n<p>Probably the most obvious health check for a Unix/Linux system is to take a look at the CPU load on a system. This is the heartbeat of a Unix system. A healthy system will have CPU power to spare. And one of the best commands for giving you a quick and easy view of how hard your CPU is working is the <strong>top</strong> command. There are a number of measurements to focus on when you use the command.</p>\r\n\r\n<p>Providing a lot of information on your system\'s performance, top manages to be surprisingly concise in how it displays the measurements that it reports. In particular, the <strong>load average</strong> measurements can give you a clear view of how busy the CPU is, though the numbers only report the last 15 minutes\' worth of activity. Knowing how many processes on average are having to wait for their time on the processor tells you whether the system is working hard and how hard to keep up with demands. A load average of .50 would mean that, on average, every other time top checks, a process is having to wait to run. The three figures provided show the load averages over the last one, five, and fifteen minutes -- so you get some perspective and can also get a feel for whether the load is getting heavier or lighter. Once these numbers climb to 1.00 (especially the fifteen-minute average), a system is likely hurting. If this number increases or persists for a considerably longer time, the system\'s performance will be noticeably poor. But, again, we\'re only looking at 15 minutes worth of data.</p>\r\n\r\n<p>The <strong>top</strong> command also displays the number of running processes (196 in the listing below) and usage stats both for memory and swap space. On the system displayed below, swap is not being used at all. In fact, looking at the third line, you\'ll see that the CPU is idle more than 99% of the time. This system is obviously only lightly used.</p>\r\n\r\n<p>The memory and swap stats are shown the fourth and fifth lines of top\'s output. With no swap in use and significant free memory, this system is clearly having an easy day -- at least a very easy 15 minutes.</p>\r\n\r\n<p>If there were any processes dominating the CPU, we\'d see them in the list of tasks shown after the five summary lines. By default, <strong>top</strong> ranks its process list in order of CPU usage (highest first).</p>\r\n\r\n<pre>\r\ntop - 20:47:17 up  4:25,  3 users,  load average: <strong>0.54, 0.15, 0.05</strong>\r\nTasks: <strong>196 total</strong>,   1 running, 195 sleeping,   0 stopped,   0 zombie\r\n%Cpu(s):  0.3 us,  0.2 sy,  0.0 ni, <strong>99.5 id</strong>,  0.0 wa,  0.0 hi,  0.0 si,  0.0 st\r\nKiB Mem :  2017064 total,   <strong>662924 free</strong>,   448904 used,   905236 buff/cache\r\nKiB Swap:  3635904 total,  3635904 free,        <strong>0 used</strong>.  1091240 avail Mem\r\n\r\n  PID USER      PR  NI    VIRT    RES    SHR S  %CPU %MEM     TIME+ COMMAND\r\n 1775 shs       20   0  273460  79668  48676 S   0.3  3.9   0:49.03 compiz\r\n 3811 shs       20   0    9944   3640   3092 R   0.3  0.2   0:00.52 top\r\n    1 root      20   0   27360   6592   5132 S   0.0  0.3   0:02.48 systemd\r\n    2 root      20   0       0      0      0 S   0.0  0.0   0:00.00 kthreadd\r\n    4 root       0 -20       0      0      0 S   0.0  0.0   0:00.00 kworker/0:+\r\n    6 root      20   0       0      0      0 S   0.0  0.0   0:00.02 ksoftirqd/0\r\n    7 root      20   0       0      0      0 S   0.0  0.0   0:00.49 rcu_sched\r\n    8 root      20   0       0      0      0 S   0.0  0.0   0:00.00 rcu_bh\r\n    9 root      rt   0       0      0      0 S   0.0  0.0   0:00.00 migration/0\r\n   10 root       0 -20       0      0      0 S   0.0  0.0   0:00.00 lru-add-dr+\r\n   11 root      rt   0       0      0      0 S   0.0  0.0   0:00.00 watchdog/0\r\n   12 root      20   0       0      0      0 S   0.0  0.0   0:00.00 cpuhp/0\r\n   13 root      20   0       0      0      0 S   0.0  0.0   0:00.00 cpuhp/1\r\n   14 root      rt   0       0      0      0 S   0.0  0.0   0:00.01 watchdog/1\r\n   15 root      rt   0       0      0      0 S   0.0  0.0   0:00.12 migration/1\r\n   16 root      20   0       0      0      0 S   0.0  0.0   0:00.03 ksoftirqd/1\r\n   18 root       0 -20   </pre>\r\n\r\n<p>Using the <strong>sar</strong> command, you can get an idea if what you see in your top output has held true for a considerably longer period of time. In the example below, <strong>sar</strong> has been collecting data every ten minutes for almost an hour and a half.</p>\r\n\r\n<pre>\r\nstinkbug# sar\r\nLinux 4.10.0-19-generic (stinkbug)      05/08/2017      _i686_  (2 CPU)\r\n\r\n19:32:20     LINUX RESTART      (2 CPU)\r\n\r\n07:35:01 PM     CPU     %user     %nice   %system   %iowait    %steal     %idle\r\n07:45:01 PM     all      0.15      0.00      0.02      0.02      0.00     99.80\r\n07:55:01 PM     all      0.14      0.00      0.02      0.02      0.00     99.82\r\n08:05:01 PM     all      0.15      0.00      0.02      0.02      0.00     99.81\r\n08:15:01 PM     all      0.15      0.00      0.02      0.02      0.00     99.80\r\n08:25:01 PM     all      0.15      0.00      0.02      0.02      0.00     99.82\r\n08:35:01 PM     all      0.14      0.00      0.02      0.02      0.00     99.83\r\n08:45:01 PM     all      0.22      0.00      0.06      0.05      0.00     99.67\r\n08:55:01 PM     all      0.55      0.00      0.70      2.70      0.00     96.05\r\nAverage:        all      0.21      0.00      0</pre>\r\n\r\n<p>In this example, it\'s clear that this system is consistently only lightly used.</p>\r\n\r\n<p>One of the key benefits of <strong>sar</strong> is that can collect information around the clock, so that you can see how your system is performing even when you\'re not available to look. You can also use it to look at how the system is running right now. In the example below, we\'re asking for three data samples, each 5 seconds apart.</p>\r\n\r\n<pre>\r\nstinkbug# sar -u 5 3\r\nLinux 4.10.0-19-generic (stinkbug)      05/08/2017      _i686_  (2 CPU)\r\n\r\n09:04:09 PM     CPU     %user     %nice   %system   %iowait    %steal     %idle\r\n09:04:14 PM     all      0.20      0.00      0.20      0.00      0.00     99.60\r\n09:04:19 PM     all      0.10      0.00      0.20      0.00      0.00     99.70\r\n09:04:24 PM     all      0.20      0.00      0.10      0.00      0.00     99.70\r\nAverage:        all      0.17      0.00      0.17      0.00      0.00     99.67</pre>\r\n\r\n<p>Both the <strong>top</strong> and <strong>sar</strong> commands shown above provide data on how the CPU on the system is spending its time. While largely 99% or more idle, the CPU on this system is also spending a small amount of time running user processes ("%user" or "us") and a small amount of time for system tasks ("%system" or "sy"). On a busy system, these numbers can help you to determine why the system is so busy.</p>\r\n\r\n<h3>Memory Usage</h3>\r\n\r\n<p>To look <em>just</em> at memory and swap space, the <strong>free</strong> command is the most convenient one to use. It will display the same variety of data that <strong>top</strong> provides, but just the memory stats.</p>\r\n\r\n<pre>\r\nstinkbug$ free\r\n             total       used       free     shared    buffers     cached\r\nMem:       2074932    1837504     237428          0     523476     815368\r\n-/+ buffers/cache:     498660    1576272\r\nSwap:      4192956        112    4192844\r\n</pre>\r\n\r\n<p>&lt;p&gt;If you run the &lt;b&gt;free&lt;/b&gt; command with the &lt;b&gt;-m&lt;/b&gt; option, the numbers will be expressed in megabytes – probably easier on the eyes!&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you run the <strong>free</strong> command with the <strong>-m</strong> option, the numbers will be expressed in megabytes – probably easier on the eyes!</p>\r\n\r\n<pre>\r\nstinkbug$ free -m\r\n             total       used       free     shared    buffers     cached\r\nMem:          2026       1794        231          0        511        796\r\n-/+ buffers/cache:        486       1539\r\nSwap:         4094          0       4094\r\n</pre>\r\n\r\n<p>The take-homes for this system are that swap space is not being used and a good amount of memory is free and available (nearly 1/3 of it not in use).</p>\r\n\r\n<h3>Paging and swapping</h3>\r\n\r\n<p>When the memory on a system is in high demand, the system has to use paging and swapping – the processes that move process data out of memory and off to the swap device and back when needed. This allows the system to behave as if it has more physical memory than it does, but comes at some cost in terms of performance. A system that is doing a lot of swapping will likely slow down considerably. The columns to focus on are the <strong>si</strong> (average number of LWPs swapped in per second) and <strong>so</strong> (number of whole processes swapped out) columns. These numbers are all 0 in the example below, but imagine them populated with numbers with two or three digits.</p>\r\n\r\n<pre>\r\nstinkbug# vmstat\r\nprocs -----------memory---------- ---swap-- -----io---- -system-- ------cpu-----\r\n r  b   swpd   free   buff  cache   <strong>si</strong>   <strong>so</strong>    bi    bo   in   cs us sy id wa st\r\n 0  0      0 663184 132276 772964    0    0    15     2   16   53  0  0 99  0  0\r\nstinkbug# vmstat 5 3\r\nprocs -----------memory---------- ---swap-- -----io---- -system-- ------cpu-----\r\n r  b   swpd   free   buff  cache   <strong>si</strong>   <strong>so</strong>    bi    bo   in   cs us sy id wa st\r\n 0  0      0 662936 132284 772996    0    0    15     2   16   53  0  0 99  0  0\r\n 0  0      0 662928 132284 772996    0    0     0     0   27   52  0  0 100  0  0\r\n 0  0      0 662928 132284 772996    0    0     0     1   28   55  0  0 100  0  0\r\n</pre>\r\n\r\n<h3>Disk IO</h3>\r\n\r\n<p>The iostat command (particularly <strong>iostat -x</strong>)is useful for observing device input/output loading. Sometimes this information is used to justify changing the system configuration to better balance the load between devices. To make use of this information, you have to be able to translate the space-saving acronyms hovering over the device measurements -- like rrqm/s and rkB/s.</p>\r\n\r\n<pre>\r\nrrqm/s, wrqm/s -- number of merged read and write requests queued per second\r\nr/s, w/s -- number of read and write requests per second\r\nrkB/s -- number of kilobytes read from the device per second\r\nwkB/s -- number of kilobytes written to the device per second\r\navgrq-sz -- average request size (in sectors)\r\navgqu-sz -- number of requests waiting in the device’s queue\r\nawait -- average time (milliseconds) for I/O requests to be served\r\nr_await, w_await -- average time (milliseconds) for read and write requests to be served\r\nsvctm -- number of milliseconds spent servicing request\r\n%util -- percentage of CPU time during which requests were issued\r\n</pre>\r\n\r\n<p>Of these, the <strong>avgqu-sz</strong> is one of the most important. A low value generally indicates that your systems is not heavily loaded.</p>\r\n\r\n<pre>\r\nstinkbug# iostat -x 5 3\r\nLinux 4.10.0-19-generic (stinkbug)      05/08/2017      _i686_  (2 CPU)\r\n\r\navg-cpu:  %user   %nice %system %iowait  %steal   %idle\r\n           0.24    0.01    0.09    0.33    0.00   99.33\r\n\r\nDevice:         rrqm/s   wrqm/s     r/s     w/s    rkB/s    wkB/s avgrq-sz avgqu-sz   await r_await w_await  svctm  %util\r\nsda               0.67     0.17    1.75    0.11    29.38     3.46    35.45     0.02   10.78    8.94   41.38   2.93   0.54\r\n</pre>\r\n\r\n<h3>Disk space</h3>\r\n\r\n<p>Disks can fill up fast depending on what\'s happening on a system. Be aware of disks that might be getting close to filling up. I\'ve often set up systems that I managed to send me warnings when the used space reached particular thresholds -- like 75% full, 90% full, and 98% full. In the example below, we see a couple of disks that are getting close.</p>\r\n\r\n<pre>\r\ndragonfly# df\r\nFilesystem           1K-blocks      Used Available Use% Mounted on\r\n/dev/sda1             78361192  23185840  51130588  32% /\r\n/dev/sda2             24797380  22273432   1243972  95% /home\r\n/dev/sda3             29753588  25503792   2713984  91% /data\r\n/dev/sda4               295561     21531    258770   8% /boot\r\ntmpfs                   257476         0    257476   0% /dev/shm\r\n</pre>\r\n\r\n<h3>The hardware</h3>\r\n\r\n<p>Don\'t depend on the command line to tell you everything you need to know to ensure that the systems you manage are in good shape. Check them from time to time in person. Look for warning lights and fans that might not be working as well as expected. Make sure that critical systems are plugged into UPS devices whenever possible.</p>\r\n\r\n<h3>Backups</h3>\r\n\r\n<p>Also remember that usable backups are an important part of system health. A system that cannot be fully resuscitated after a data disaster is not in good shape. Check your backups regularly to ensure that they are usable.</p>\r\n\r\n<h3>Wrap-up</h3>\r\n\r\n<p>Being proactive can help you ward off system problems long before they threaten operations. Periodic health checks can also help you to be familiar with how a system is generally performing and this can help you recognize when a system is undergoing an unusual problem.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'full_html'),
('node', 'article', 0, 5, 5, 'und', 0, '<p>You won\'t need to buy a rack of 400 servers if you have one high-powered Nvidia DGX-1 supercomputer with a Volta GPU sitting on your desktop.</p>\r\n\r\n<p>The DGX-1 supercomputer -- which looks like a regular rack server -- gets most of its computing power from eight Tesla V100 GPUs.</p>\r\n\r\n<p>The GPU, the first one based on the brand-new Volta architecture, was introduced at the company\'s GPU Technology Conference in San Jose, Calif. on Wednesday.</p>\r\n\r\n<p>"It comes out of the box, plug it in and go to work," said Nvidia\'s CEO Jen-Hsun Huang during a keynote speech.</p>\r\n\r\n<p>But the DGX-1 with Tesla V100 computer is expensive. At $149,000, it\'s worth some people\'s life savings. But Huang encouraged people to order it, saying the box will ship in the third quarter.</p>\r\n\r\n<p>The new supercomputer 40,960 CUDA cores, which Nvidia says equals the computing power of 800 CPUs. It replaces the previous DGX-1 based on the current Pascal architecture, which has the power of 250 two-socket servers, according to Nvidia.</p>\r\n\r\n<p>Nvidia says the system delivers about 960 teraflops of half-precision -- 16-bit floating point -- performance, which means lower single-precision and double-precision performance. The numbers weren\'t available, but half-precision performance is considered valuable for machine-learning tasks.</p>\r\n\r\n<p>Accompanying the GPUs are two 20-core Intel Xeon E5-2698 v4s running at clock speeds of 2.2GHz. The system has four 1.92TB SSDs and runs on Ubuntu Linux.</p>\r\n\r\n<p>The system draws 3,200 watts of power, so don\'t keep it running all day long, or it\'ll run up your electricity bil<strong>l.</strong></p>\r\n\r\n<p>Gamers shouldn\'t get excited about the machine. The DGX-1 with Tesla V100 is perhaps too expensive to be a huge gaming rig; it is instead designed more for machine learning.</p>\r\n\r\n<p>GPUs already power machine-learning tasks in data centers, and the Nvidia supercomputer is an example of how GPUs are making applications like image recognition and natural language processing a reality.</p>\r\n\r\n<p>Huang said CPUs do not provide enough power for computing, especially for artificial intelligence, which is where GPU fit in.</p>\r\n\r\n<p>The Tesla V100 in the DGX-1 is five times faster than the current Pascal architecture, Huang said. It will have new technologies like NVLink 2.0, a new interconnect with bandwidth of up to 300Gbps (bits per second). The GPU has more than 21 billion transistors and 5,120 cores. It also has 900GBps (bytes per second) of HBM2 memory bandwidth.</p>\r\n\r\n<p>Nvidia has also included a cube-like Tensor Core, which will work with the regular processing cores to improve deep learning. Nvidia focused on structuring cores to speed up matrix multiplications, which are the heart of effective deep-learning systems. The structure will help align low-level floating-point calculations, which should speed up deep learning.</p>\r\n\r\n<p>Huang boasted the GPU offers 120 teraflops of deep-learning performance, though that\'ll be hard to verify. Standard benchmarking tools don\'t exist for machine- or deep-learning applications, though development is underway at companies like Google.</p>\r\n\r\n<p>The supercomputer works with many high-performance computing and deep-learning frameworks like CUDA, Tensor, and Caffe2.</p>\r\n\r\n<p>The graphics company also introduced the DGX Station, which is a smaller version of the new DGX-1. It looks more like a workstation and has four Tesla V100 GPUs, half that of the DGX-1. It is priced at $69,000 and will ship in the third quarter.</p>\r\n\r\n<p>Nvidia didn\'t immediately say if the products will be shipped worldwide.</p>\r\n', '', 'full_html'),
('node', 'article', 0, 8, 8, 'und', 0, '<p><span style="font-family:georgia,serif">Industrial robots used in factories and warehouses that are connected to the internet are not secure, leaving companies open to cyberattacks and costly damages.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">That\'s the word coming from a study conducted by global security software company Trend Micro and Polytechnic University of Milan, the largest technical university in Italy.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">"The industrial robot – it\'s not ready for the world it\'s living in," said Mark Nunnikhoven, vice president of cloud research at Trend Micro. "The reality is these things are being connected in more and more places. There are a lot of attacks that could happen in that environment."</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">The <a href="https://www.trendmicro.com/vinfo/us/security/news/internet-of-things/rogue-robots-testing-industrial-robot-security" target="_blank">study</a>&nbsp;looked at Internet security vulnerabilities that could involve industrial robots used on manufacturing lines in areas such as the automobile and aerospace industries. The robots, which generally look like large mechanical arms, are used to move heavy objects, weld seams and fit pieces together. The machines also can be found moving and stacking crates in warehouses.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">The issue is taking on greater significance as the use of robots grows in factories around the world. The International Federation of Robotics, in its <a href="https://ifr.org/ifr-press-releases/news/world-robotics-report-2016" target="_blank">World Robotics Report</a>, said that 2.6 million industrial robots will be deployed worldwide by 2019, an increase of about 1 million since 2015.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">While companies are careful to ensure that industrial robots are safe to work near people, they\'re often not set up for cybersecurity. But these robots, according to Nunnikhoven, are increasingly being linked to company networks and the internet.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">As long as there are proper security precautions, analysts said these robots can be connected to the internet. They need cybersecurity basics such as user names and passwords, two-factor authentication, encryption and hardware-based biometric authentication.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">"I\'m shocked that anyone would consider attaching anything to the internet without making sure it was secured," said Dan Olds, an analyst with OrionX. "This applies to everything from home thermostats to big robotic arms. Everything attached to the internet is vulnerable to hacking."</span></p>\r\n\r\n<p><span style="font-family:georgia,serif"><strong>[ To comment on this story, visit <a href="https://www.facebook.com/Computerworld/posts/10155292372949680" target="_blank">Computerworld\'s Facebook page</a>. ]</strong></span></p>\r\n\r\n<p><span style="font-family:georgia,serif">Patrick Moorhead, an analyst with Moor Insights &amp; Strategy, said he was surprised that enterprises would forgo security on anything connected to the internet.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">"The only thing I could attribute this to would be ignorance and maybe a way to save a few dollars here and there," he said. "This could be incredibly dangerous. To protect the security of robots there should be protection all the way from the robot to the network to the data center. Data should be protected at rest and in flight. This means a secure chain of command, end to end, using encryption every step of the way as well as hardware-based biometric authentication all the way through the chain."</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">Mike Gennert, a professor and director of the Robotics Engineering Program at Worcester Polytechnic Institute, in Worcester, Mass., said unsecured robots are the result of IT departments having to work with a new technology.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">“It’s a whole other level of complexity in our systems,” Gennert said. “In the past, when you had a robot on a factory floor, it wasn’t part of a network that the outside world could view. There was a limited ability for malicious actors to connect with your robot. Now all these devices are on the internet and they’re all exposed.”</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">That means that companies will need to make sure there are IT managers, or even C-level executives, who can oversee robotics, making sure the technology is supporting the company’s business strategy while also making sure the machines are secure.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">One challenge for companies will be to find people who have experience in both robotics and security. “There will be a few folks, but it will be a hot market because not many students study both robotics and security,” Gennert said. “Those that do both will be able to write their own ticket.”</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">Until companies can effectively combine robotics with security, robots may be an easy entryway for a hacker into a company\'s networks.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">Nunnikhoven said there’s no direct evidence that hackers have taken advantage of these exploits. There aren’t proper monitoring systems in place to know if the systems have been exploited, he said.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">Malicious hackers could get into a robot\'s controller system and make adjustments to its actions, which could create a dangerous situation in the factory or could enable the robots to build unsafe products on the production line.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">Hackers also could gain access to the programming used to make the company\'s products, or they could use the robot as a jumping off point to hack into other enterprise systems. Companies could fall victim to ransomware or sabotage.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">"This is dangerous in several ways," said Olds. "The first is pretty obvious -- a hacker gets control of a robot and uses it to destroy company products or to hurt a human operator."</span></p>\r\n\r\n<h3><span style="font-family:georgia,serif">How the research was done</span></h3>\r\n\r\n<p><span style="font-family:georgia,serif">"We looked at cybersecurity [because the robots] are being connected to larger networks and the internet itself," he said. "During our research, the team found more than 83,000 of these robots exposed to the internet."</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">Trend Micro got that number by running searches for about two weeks on <a href="https://www.shodan.io" target="_blank">Shodan</a>, <a href="https://www.zoomeye.org" target="_blank">ZoomEye</a> and <a href="https://censys.io" target="_blank">Censys</a>, search services that index data from internet-wide scans, looking for things like web cams, routers, servers and devices on the internet of things.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">They then zeroed in on the industrial routers and robots that responded to their queries.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">If the industrial robots responded, that meant they were not only connected to the internet but they were exposed. If secured, the robots wouldn’t be directly accessible from an unauthenticated random IP address querying them.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">The robots’ responses also gave researchers the software version they were running, along with their manufacturer.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">The study found industrial robots from five different vendors -- like ABB Robotics, FANUC FTP, Yaskawa, Kawasaki E Controller and Mitsubishi FTP -- and 12 of their brands of industrial robots. More than 80,000 of them are working in factories around the world.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">Nunnikhoven said it’s unclear how many companies are operating these robots, but more than 10,000 of the machines are running in the U.S. The U.S., followed by Australia and Japan, were the three countries with the highest number of exposed industrial robots.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">“It reflects the U.S. take on manufacturing,” said Nunnikhoven. “There’s a resurgence in trying to get smarter factories, and smarter factories would tend to have more industrial robots in play.”</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">According to the study, of the more than 83,000 exposed industrial robots, 59 had known vulnerabilities and more than 5,100 had no authentication.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">So why would a company link an industrial robot working on a manufacturing line to the internet? Company IT managers might want internet access to robots so they could remotely adjust the robot\'s programming or check the status of their factory lines.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">“There is some logic to it, but a lot of warning flags too,” Nunnikhoven said. “People tend to look at the positive and the possibilities, and they don’t look at the risks. They say, ‘Hey, we can query from one central location or get status from manufacturing lines in real time, even though we’re manufacturing from the other side of the planet. This exposes you to significant risks.”</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">Nunnikhoven said the researchers worked in isolation -- as opposed to a robot operating on a live factory floor. He said the researchers were able to hack into an industrial robot used for welding that had been set up like many typically are in factory situations. Once they had hacked in, the researchers were able to alter the robot’s configuration so it was no longer welding in a straight line.</span></p>\r\n\r\n<p><span style="font-family:georgia,serif">“The robot has to be extremely precise,” Nunnikhoven explained. “Say, a [robotic] arm is doing a weld on a car line. It has to be very accurate to ensure the car chassis is strong enough to withstand impact and meet safety regulations. If they add a curve in [the weld], that’s a defect and that could be catastrophic when that car hits the road.”</span></p>\r\n', '', 'full_html'),
('node', 'page', 0, 10, 10, 'und', 0, '<p>contact us if you have any question or want to share something.</p>\r\n', '', 'full_html');
