(1, 'node', ' health tips for unix systems periodic health checks can help ensure that your unix systems are going to be available when they re needed most in this post we re going to look at some aspects of performance that should be included in your system checkups and some handy commands that will provide you with some especially useful insights cpu load probably the most obvious health check for a unix linux system is to take a look at the cpu load on a system this is the heartbeat of a unix system a healthy system will have cpu power to spare and one of the best commands for giving you a quick and easy view of how hard your cpu is working is the top command there are a number of measurements to focus on when you use the command providing a lot of information on your system s performance top manages to be surprisingly concise in how it displays the measurements that it reports in particular the load average measurements can give you a clear view of how busy the cpu is though the numbers only report the last 15 minutes worth of activity knowing how many processes on average are having to wait for their time on the processor tells you whether the system is working hard and how hard to keep up with demands a load average of 50 would mean that on average every other time top checks a process is having to wait to run the three figures provided show the load averages over the last one five and fifteen minutes so you get some perspective and can also get a feel for whether the load is getting heavier or lighter once these numbers climb to 100 especially the fifteenminute average a system is likely hurting if this number increases or persists for a considerably longer time the system s performance will be noticeably poor but again we re only looking at 15 minutes worth of data the top command also displays the number of running processes 196 in the listing below and usage stats both for memory and swap space on the system displayed below swap is not being used at all in fact looking at the third line you ll see that the cpu is idle more than 99 of the time this system is obviously only lightly used the memory and swap stats are shown the fourth and fifth lines of top s output with no swap in use and significant free memory this system is clearly having an easy day at least a very easy 15 minutes if there were any processes dominating the cpu we d see them in the list of tasks shown after the five summary lines by default  top ranks its process list in order of cpu usage highest first top 204717 up 425 3 users load average  54 15 5 tasks  196 total  1 running 195 sleeping  stopped  zombie cpu s 3 us 2 sy  ni  995 id   wa  hi  si  st kib mem 2017064 total  662924 free  448904 used 905236 buff cache kib swap 3635904 total 3635904 free   used  1091240 avail mem pid user pr ni virt res shr s cpu mem time command 1775 shs 20  273460 79668 48676 s 3 39 4903 compiz 3811 shs 20  9944 3640 3092 r 3 2 52 top 1 root 20  27360 6592 5132 s  3 248 systemd 2 root 20     s    kthreadd 4 root  20    s    kworker  6 root 20     s   2 ksoftirqd  7 root 20     s   49 rcusched 8 root 20     s    rcubh 9 root rt     s    migration  10 root  20    s    lruadddr 11 root rt     s    watchdog  12 root 20     s    cpuhp  13 root 20     s    cpuhp 1 14 root rt     s   1 watchdog 1 15 root rt     s   12 migration 1 16 root 20     s   3 ksoftirqd 1 18 root  20 using the sar command you can get an idea if what you see in your top output has held true for a considerably longer period of time in the example below  sar has been collecting data every ten minutes for almost an hour and a half stinkbug sar linux 410019generic stinkbug 5082017 i686 2 cpu 193220 linux restart 2 cpu 73501 pm cpu user nice system iowait steal idle 74501 pm all 15  2 2  9980 75501 pm all 14  2 2  9982 80501 pm all 15  2 2  9981 81501 pm all 15  2 2  9980 82501 pm all 15  2 2  9982 83501 pm all 14  2 2  9983 84501 pm all 22  6 5  9967 85501 pm all 55  70 270  9605 average all 21   in this example it s clear that this system is consistently only lightly used one of the key benefits of sar is that can collect information around the clock so that you can see how your system is performing even when you re not available to look you can also use it to look at how the system is running right now in the example below we re asking for three data samples each 5 seconds apart stinkbug sar u 5 3 linux 410019generic stinkbug 5082017 i686 2 cpu 90409 pm cpu user nice system iowait steal idle 90414 pm all 20  20   9960 90419 pm all 10  20   9970 90424 pm all 20  10   9970 average all 17  17   9967 both the top and sar commands shown above provide data on how the cpu on the system is spending its time while largely 99 or more idle the cpu on this system is also spending a small amount of time running user processes user or us and a small amount of time for system tasks system or sy on a busy system these numbers can help you to determine why the system is so busy memory usage to look just at memory and swap space the free command is the most convenient one to use it will display the same variety of data that top provides but just the memory stats stinkbug free total used free shared buffers cached mem 2074932 1837504 237428  523476 815368 buffers cache 498660 1576272 swap 4192956 112 4192844 p if you run the b free b command with the b m b option the numbers will be expressed in megabytes probably easier on the eyes p if you run the free command with the m option the numbers will be expressed in megabytes probably easier on the eyes stinkbug free m total used free shared buffers cached mem 2026 1794 231  511 796 buffers cache 486 1539 swap 4094  4094 the takehomes for this system are that swap space is not being used and a good amount of memory is free and available nearly 13 of it not in use  paging and swapping when the memory on a system is in high demand the system has to use paging and swapping the processes that move process data out of memory and off to the swap device and back when needed this allows the system to behave as if it has more physical memory than it does but comes at some cost in terms of performance a system that is doing a lot of swapping will likely slow down considerably the columns to focus on are the si  average number of lwps swapped in per second and so  number of whole processes swapped out columns these numbers are all  in the example below but imagine them populated with numbers with two or three digits stinkbug vmstat procs memory swap io system cpu r b swpd free buff cache si so bi bo in cs us sy id wa st    663184 132276 772964   15 2 16 53   99   stinkbug vmstat 5 3 procs memory swap io system cpu r b swpd free buff cache si so bi bo in cs us sy id wa st    662936 132284 772996   15 2 16 53   99      662928 132284 772996     27 52   100      662928 132284 772996    1 28 55   100   disk io the iostat command particularly iostat x  is useful for observing device input output loading sometimes this information is used to justify changing the system configuration to better balance the load between devices to make use of this information you have to be able to translate the spacesaving acronyms hovering over the device measurements like rrqm s and rkb s rrqm s wrqm s number of merged read and write requests queued per second r s w s number of read and write requests per second rkb s number of kilobytes read from the device per second wkb s number of kilobytes written to the device per second avgrqsz average request size in sectors avgqusz number of requests waiting in the device s queue await average time milliseconds for i o requests to be served rawait wawait average time milliseconds for read and write requests to be served svctm number of milliseconds spent servicing request util percentage of cpu time during which requests were issued of these the avgqusz is one of the most important a low value generally indicates that your systems is not heavily loaded stinkbug iostat x 5 3 linux 410019generic stinkbug 5082017 i686 2 cpu avgcpu user nice system iowait steal idle 24 1 9 33  9933 device rrqm s wrqm s r s w s rkb s wkb s avgrqsz avgqusz await rawait wawait svctm util sda 67 17 175 11 2938 346 3545 2 1078 894 4138 293 54 disk space disks can fill up fast depending on what s happening on a system be aware of disks that might be getting close to filling up i ve often set up systems that i managed to send me warnings when the used space reached particular thresholds like 75 full 90 full and 98 full in the example below we see a couple of disks that are getting close dragonfly df filesystem 1kblocks used available use mounted on dev sda1 78361192 23185840 51130588 32 dev sda2 24797380 22273432 1243972 95 home dev sda3 29753588 25503792 2713984 91 data dev sda4 295561 21531 258770 8 boot tmpfs 257476  257476  dev shm the hardware don t depend on the command line to tell you everything you need to know to ensure that the systems you manage are in good shape check them from time to time in person look for warning lights and fans that might not be working as well as expected make sure that critical systems are plugged into ups devices whenever possible backups also remember that usable backups are an important part of system health a system that cannot be fully resuscitated after a data disaster is not in good shape check your backups regularly to ensure that they are usable wrapup being proactive can help you ward off system problems long before they threaten operations periodic health checks can also help you to be familiar with how a system is generally performing and this can help you recognize when a system is undergoing an unusual problem  unix systems programming ', 0),
