(5, 'node', ' nvidia s voltabased dgx1 supercomputer puts 400 servers in a box you won t need to buy a rack of 400 servers if you have one highpowered nvidia dgx1 supercomputer with a volta gpu sitting on your desktop the dgx1 supercomputer which looks like a regular rack server gets most of its computing power from eight tesla v100 gpus the gpu the first one based on the brandnew volta architecture was introduced at the company s gpu technology conference in san jose calif on wednesday it comes out of the box plug it in and go to work said nvidia s ceo jenhsun huang during a keynote speech but the dgx1 with tesla v100 computer is expensive at 149000 it s worth some people s life savings but huang encouraged people to order it saying the box will ship in the third quarter the new supercomputer 40960 cuda cores which nvidia says equals the computing power of 800 cpus it replaces the previous dgx1 based on the current pascal architecture which has the power of 250 twosocket servers according to nvidia nvidia says the system delivers about 960 teraflops of halfprecision 16bit floating point performance which means lower singleprecision and doubleprecision performance the numbers weren t available but halfprecision performance is considered valuable for machinelearning tasks accompanying the gpus are two 20core intel xeon e52698 v4s running at clock speeds of 22ghz the system has four 192tb ssds and runs on ubuntu linux the system draws 3200 watts of power so don t keep it running all day long or it ll run up your electricity bil l gamers shouldn t get excited about the machine the dgx1 with tesla v100 is perhaps too expensive to be a huge gaming rig it is instead designed more for machine learning gpus already power machinelearning tasks in data centers and the nvidia supercomputer is an example of how gpus are making applications like image recognition and natural language processing a reality huang said cpus do not provide enough power for computing especially for artificial intelligence which is where gpu fit in the tesla v100 in the dgx1 is five times faster than the current pascal architecture huang said it will have new technologies like nvlink 20 a new interconnect with bandwidth of up to 300gbps bits per second the gpu has more than 21 billion transistors and 5120 cores it also has 900gbps bytes per second of hbm2 memory bandwidth nvidia has also included a cubelike tensor core which will work with the regular processing cores to improve deep learning nvidia focused on structuring cores to speed up matrix multiplications which are the heart of effective deeplearning systems the structure will help align lowlevel floatingpoint calculations which should speed up deep learning huang boasted the gpu offers 120 teraflops of deeplearning performance though that ll be hard to verify standard benchmarking tools don t exist for machine or deeplearning applications though development is underway at companies like google the supercomputer works with many highperformance computing and deeplearning frameworks like cuda tensor and caffe2 the graphics company also introduced the dgx station which is a smaller version of the new dgx1 it looks more like a workstation and has four tesla v100 gpus half that of the dgx1 it is priced at 69000 and will ship in the third quarter nvidia didn t immediately say if the products will be shipped worldwide computers data ', 0),
