(8, 'node', ' industrial robots are security weak link industrial robots used in factories and warehouses that are connected to the internet are not secure leaving companies open to cyberattacks and costly damages that s the word coming from a study conducted by global security software company trend micro and polytechnic university of milan the largest technical university in italy the industrial robot it s not ready for the world it s living in said mark nunnikhoven vice president of cloud research at trend micro the reality is these things are being connected in more and more places there are a lot of attacks that could happen in that environment the study  looked at internet security vulnerabilities that could involve industrial robots used on manufacturing lines in areas such as the automobile and aerospace industries the robots which generally look like large mechanical arms are used to move heavy objects weld seams and fit pieces together the machines also can be found moving and stacking crates in warehouses the issue is taking on greater significance as the use of robots grows in factories around the world the international federation of robotics in its world robotics report  said that 26 million industrial robots will be deployed worldwide by 2019 an increase of about 1 million since 2015 while companies are careful to ensure that industrial robots are safe to work near people they re often not set up for cybersecurity but these robots according to nunnikhoven are increasingly being linked to company networks and the internet as long as there are proper security precautions analysts said these robots can be connected to the internet they need cybersecurity basics such as user names and passwords twofactor authentication encryption and hardwarebased biometric authentication i m shocked that anyone would consider attaching anything to the internet without making sure it was secured said dan olds an analyst with orionx this applies to everything from home thermostats to big robotic arms everything attached to the internet is vulnerable to hacking   to comment on this story visit computerworld s facebook page   patrick moorhead an analyst with moor insights strategy said he was surprised that enterprises would forgo security on anything connected to the internet the only thing i could attribute this to would be ignorance and maybe a way to save a few dollars here and there he said this could be incredibly dangerous to protect the security of robots there should be protection all the way from the robot to the network to the data center data should be protected at rest and in flight this means a secure chain of command end to end using encryption every step of the way as well as hardwarebased biometric authentication all the way through the chain mike gennert a professor and director of the robotics engineering program at worcester polytechnic institute in worcester mass said unsecured robots are the result of it departments having to work with a new technology it s a whole other level of complexity in our systems gennert said in the past when you had a robot on a factory floor it wasn t part of a network that the outside world could view there was a limited ability for malicious actors to connect with your robot now all these devices are on the internet and they re all exposed that means that companies will need to make sure there are it managers or even clevel executives who can oversee robotics making sure the technology is supporting the company s business strategy while also making sure the machines are secure one challenge for companies will be to find people who have experience in both robotics and security there will be a few folks but it will be a hot market because not many students study both robotics and security gennert said those that do both will be able to write their own ticket until companies can effectively combine robotics with security robots may be an easy entryway for a hacker into a company s networks nunnikhoven said there s no direct evidence that hackers have taken advantage of these exploits there aren t proper monitoring systems in place to know if the systems have been exploited he said malicious hackers could get into a robot s controller system and make adjustments to its actions which could create a dangerous situation in the factory or could enable the robots to build unsafe products on the production line hackers also could gain access to the programming used to make the company s products or they could use the robot as a jumping off point to hack into other enterprise systems companies could fall victim to ransomware or sabotage this is dangerous in several ways said olds the first is pretty obvious a hacker gets control of a robot and uses it to destroy company products or to hurt a human operator  how the research was done  we looked at cybersecurity because the robots are being connected to larger networks and the internet itself he said during our research the team found more than 83000 of these robots exposed to the internet trend micro got that number by running searches for about two weeks on shodan   zoomeye and censys  search services that index data from internetwide scans looking for things like web cams routers servers and devices on the internet of things they then zeroed in on the industrial routers and robots that responded to their queries if the industrial robots responded that meant they were not only connected to the internet but they were exposed if secured the robots wouldn t be directly accessible from an unauthenticated random ip address querying them the robots responses also gave researchers the software version they were running along with their manufacturer the study found industrial robots from five different vendors like abb robotics fanuc ftp yaskawa kawasaki e controller and mitsubishi ftp and 12 of their brands of industrial robots more than 80000 of them are working in factories around the world nunnikhoven said it s unclear how many companies are operating these robots but more than 10000 of the machines are running in the us the us followed by australia and japan were the three countries with the highest number of exposed industrial robots it reflects the us take on manufacturing said nunnikhoven there s a resurgence in trying to get smarter factories and smarter factories would tend to have more industrial robots in play according to the study of the more than 83000 exposed industrial robots 59 had known vulnerabilities and more than 5100 had no authentication so why would a company link an industrial robot working on a manufacturing line to the internet company it managers might want internet access to robots so they could remotely adjust the robot s programming or check the status of their factory lines there is some logic to it but a lot of warning flags too nunnikhoven said people tend to look at the positive and the possibilities and they don t look at the risks they say hey we can query from one central location or get status from manufacturing lines in real time even though we re manufacturing from the other side of the planet this exposes you to significant risks nunnikhoven said the researchers worked in isolation as opposed to a robot operating on a live factory floor he said the researchers were able to hack into an industrial robot used for welding that had been set up like many typically are in factory situations once they had hacked in the researchers were able to alter the robot s configuration so it was no longer welding in a straight line the robot has to be extremely precise nunnikhoven explained say a robotic arm is doing a weld on a car line it has to be very accurate to ensure the car chassis is strong enough to withstand impact and meet safety regulations if they add a curve in the weld that s a defect and that could be catastrophic when that car hits the road  robatics secutrity industrial robots emerging technology ', 0),
